INSERT INTO `opensns_version` (`title`, `create_time`, `update_time`, `log`, `url`, `number`, `name`, `is_current`) VALUES
('开发者预览版', 1431651600, 1434503121, '暂无', 'http://www.opensns.cn/article/16_200.html', 20150515, '2.0.0', 0),
('beta版', 1432332000, 1434503126, '暂无', 'http://www.opensns.cn/article/17.html', 20150602, '2.0.5', 0),
('RC版', 1434502800, 1434502800, '* 【新增】新增搜索框，但未完成搜索功能。\r\n* 【新增】安装模块的时候，如果模块的前台entry为空，则不出现添加导航功能\r\n* 【新增】新增获取用户全部积分方法\r\n* 【新增】实现自动更新文件覆盖\r\n* 【新增】新增本地比较\r\n* 【新增】新增本地文件比较\r\n* 【新增】完成自动升级第一步\r\n* 【新增】开发者工具\r\n* 【新增】自动升级的版本确认\r\n* 【新增】新增积分日志。用于记录积分的操作。以及调用方法\r\n* 【新增】完成自动升级最后一步\r\n* 【新增】新增数据库导入功能\r\n* 【新增】活动编辑器加入附件功能\r\n* 【新增】广告和广告位插件\r\n* 【新增】支持在线更新手动下载\r\n* 【新增】短信接口提示服务商\r\n* 【新增】configbuilder支持单文件上传\r\n* 【新增】新增多文件上传插件\r\n* 【新增】资讯、论坛中加入代码高亮 同时修复高亮后代一行码过长bug\r\n* 【新增】新增后台新版本监测\r\n* 【新增】论坛后台分类、板块管理页面\r\n* 【新增】后台自动更新模板\r\n* 【新增】论坛加入首页调用\r\n* 【新增】实现后台自动安装\r\n* 【新增】新增插件的在线安装\r\n* 【新增】新增用户积分及行为的前台显示。\r\n* 【新增】文章模块\r\n* 【新增】支持主题在线安装\r\n* 【新增】新增对token的验证反馈\r\n* 【新增】后台消息群发\r\n* 【新增】支持后台安装的跳转\r\n* 【新增】模块在安装的时候支持自动添加导航栏\r\n\r\n\r\n* 【调整】完全禁用活动二级分类\r\n* 【修改】伴随AdminListBuilder的清空和彻底删除修改\r\n* 【修复】修复微博清空回收站。\r\n* 【修复】【系统】系统-》网站设置-》用户设置中，新注册的用户发布微博到网站中的功能尚未实现，是否先屏蔽\r\n* 【调整】调整微博源微博变量名。\r\n* 【修复】【活动】活动详情页的样式稍作调整，报名按键和文字太靠近\r\n* 【修复】还原clear功能\r\n* 【修复】修复转发的提示错误\r\n* 【调整】调整微博变量名称\r\n* 【调整】调整会员展示头部的间距\r\n* 【修改】积分模型修改\r\n* 【修复】用户投稿时，未审核通过仍能分享到微博，其他用户可以通过微博访问该文章内容。但是资讯搜索时无该文章\r\n* 【修改】广告位置去掉微店首页\r\n* 【修改】修改编辑器保存间隔\r\n* 【修复】修复首页展示的实效项目\r\n* 【修复】修复【查看积分】个人设置中查看积分时，每天显示用户当前的等级\r\n* 【修复】修复论坛权限bug\r\n* 【调整】在后台编辑活动分类的时候，父分类不显示二级的\r\n* 【修复】修复新增用户行为里，为系统的不显示的问题。\r\n* 【调整】调整后台微博评论的排序\r\n* 【修复】修复后台群组编辑添加错误\r\n* 【修复】修复微博回收站无法彻底删除的bug\r\n* 【调整】用户行为默认展示全部，【用户行为】用户-》用户行为中，在系统模块下新增了用户行为，只显示9条行为，其他的不显示，也无法翻页\r\n* 【修复】首页链接错误\r\n* 【修复】修复注册上传头像错位\r\n* 【调整】调整升级进度计算方式。\r\n* 【修改】移除用户的不缓存字段\r\n* 【移除】移除icons_html无用变量\r\n* 【修复】修复问答编辑器ctrl+enter错误\r\n* 【修复】默认广告位配置\r\n* 【修改】修改积分缓存清理方法。支持多用户多类型\r\n* 【修改】修改清除积分缓存方法\r\n* 【修改】修改添加行为后清除积分和等级缓存\r\n* 【调整】调整云市场的链接\r\n* 【修复】修复自动更新提示\r\n* 【升级包】打包自动升级部分\r\n* 【修复】修正自动更新完成的提示文字\r\n* 【修改】修改游客@用户的情况\r\n* 【修改】在用户行为中，加上新增的积分规则的列标题\r\n* 【修改】修改注册时发送两条消息的bug\r\n* 【修改】修改消息提示\r\n* 【修复】修复个人主页粉丝和关注的错位\r\n* 【修复】补上重置用户密码的权限\r\n* 【修复】修复后台错误提示页面\r\n* 【修改】修改sourse\r\n* 【修改】修改adminconfig 以及本地评论调用\r\n* 【优化】给getPagination()和Model中getPage()增加一个rollPage参数，控制分页栏每页显示的页数\r\n* 【调整】资讯编辑器宽度调整到和展示页相同宽度\r\n* 【调整】活动编辑器宽度调整为和页面差不多宽\r\n* 【修改】修改微博插件额外参数过滤调用\r\n* 【修改】op.php\r\n* 【修复】修复上传文件无法保存的问题\r\n* 【修复】单文件上传没有文件时不显示删除按钮\r\n* 【调整】调整自动升级\r\n* 【修复】修复关注可以通过get的方式的细节。禁止get关注\r\n* 【修复】修复资讯内容展示bug\r\n* 【修复】论坛bug修复及后台分类、板块优化\r\n* 【添加】论坛漏加入版本库的文件加入\r\n* 【修复】主题安装bug修复\r\n* 【修复】论坛改进\r\n* 【修复】修复模块安装时的权限问题\r\n* 【修复】修复默认权限出错的时候导致所有权限丢失。\r\n* 【修复】修复注册和登陆的链接地址\r\n* 【修复】修复二级导航样式错误\r\n* 【修改】修改注释\r\n* 【修复】修复score个人信息出不来。\r\n* 【修复】修复用户身份设置样式bug\r\n* 【添加】论坛行为权限限制\r\n* 【调整】调整提示文字\r\n* 【修复】修复导航栏样式问题\r\n* 【修复】修复次级导航样式\r\n* 【修复】修复部分安装Bug\r\n* 【修改】消息修改\r\n* 【修改】 签到插件修改\r\n* 【修复】后台邀请码列表分页bug\r\n* 【修改】修改签到，支持按行为签到\r\n* 【修改】安装包修改。消息表\r\n* 【修改】修改因调整sendmessage方法而错误的其他方法\r\n* 【修改】未登录的时候资讯仍然可以被分享，但是分享出来的微博是无用户的。\r\n* 【修改】没有权限的时候直接在群组的导航栏里就提醒没有权限，而不是到提交表单才提示。\r\n* 【修复】修复个人主页微博点赞\r\n* 【修改】安装文件sql\r\n* 【调整】调整云市场\r\n* 【修复】修复样式问题\r\n* 【调整】在底部加上官网链接\r\n* 【修复】模板解析bug修复\r\n* 【修复】主题解析错误修复\r\n* 【修改】修改消息提示信息\r\n* 【修复】资讯审核文章时，审核失败内容填写时超过100个字仍能发表成功\r\n* 【新增】用户行为新增过滤\r\n* 【调整】用户前台积分规则按模块分组\r\n* 【修改】修改 发送消息函数，并修改调用的参数\r\n* 【修改】修改编辑器视频\r\n* 【修改】过滤微博视频flash地址发布。群组视频过滤\r\n* 【调整】调整二级导航样式\r\n* 【修改】修改配置\r\n* 【调整】调整模块未安装时的文字提示，更加友善。', 'http://v2.opensns.cn/index.php?s=/news/index/detail/id/86.html', 20150617, '2.1.0', 0),
