('2.7.5', 1450665739, 1450665739, '* 【修改】PC图片上传进度\r\n* 【多语】移除问答的语言\r\n* 【修复】修复语言函数不存在的bug\r\n* 【新增】获取user_config的函数\r\n* 【修改】PC密码找回。\r\n* 【修复】修复个人中心的语言包错误\r\n* 【新增/修改】手机网页版首页自定义，微博图片上传进度（未完成）\r\n* 【增加多种类型积分奖励。】\r\n* 【修改了虾米插件的js，增加了回车键搜索歌曲功能。】\r\n* 【修复】修复微博管理后台多语\r\n* 【新增】密码找回\r\n* 【新增】手机网页版密码找回。\r\n* 【增加签到积分奖励，后台可设置奖励的积分的类型和数值。】\r\n* 【修复】修复内容高度\r\n* 【修改】结果很简单，只是没想到---微博隐藏冲突\r\n* 【给商品和活动的站内分享增加了封面，增加了个人主页的聊天按钮。】\r\n* 【增加了活动页，论坛帖子和积分商城的商品页的站内微博分享。】\r\n* 【修复】微博置顶隐藏\r\n* 【bug】微博图片显示\r\n* 【修复】修复找人样式\r\n* 【修复】2.7.2话题字体颜色 和网站链接颜色是否不对应该是白色\r\n* 【增加了地区人数显示，修改地区字体，增加用户的地区标签】\r\n* 【提交漏交的area.html和mod_header_area.html】\r\n* 【增加了一个area.html和mod_header_area.html。在zh-cn.php中增加了''地区标签找人''，在_nav.html中增加了地区标签。增加了对地区显示的css样式。】', '', 20151221, '2.7.5', 0),
('2.7.6', 1451972620, 1451972620, '* 【同步】同步商业版一些代码用于阿里悟空聊天\r\n* 【修复】修复thumb函数\r\n* 【修复】调整变量名\r\n* 【调整】加入全局的word-break\r\n* 【修复】邮箱注册提示页面多语言\r\n* 【改进】改进微博性能\r\n* 【优化】优化微博列表速度，添加新的缓存\r\n* 【修复】修复无法检测到新的升级\r\n* 【修改】php输出js语言包\r\n* 【修复】修复get_nickname\r\n* 【修复】修复微博广告位\r\n* 【新增】兼容红包插件\r\n* 【改进】改进函数性能query_user，性能提高10倍\r\n* 【修复】修复JS语言', '', 20160105, '2.7.6', 0);
